CREATE TABLE IF NOT EXISTS professors (
    id SERIAL PRIMARY KEY,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    gender VARCHAR(20) CHECK (gender IN ('Female', 'Male', 'Non-binary')) NOT NULL,
    date_of_birth DATE NOT NULL,
    phone VARCHAR(15) NOT NULL,
    email VARCHAR(50) NOT NULL UNIQUE,
    education_level VARCHAR(3) CHECK (education_level IN ('BD', 'MD', 'PhD', 'DD')) NOT NULL,
    start_date TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
    end_date TIMESTAMPTZ NOT NULL DEFAULT '2999-01-01 00:00:00',
    is_active BOOLEAN NOT NULL DEFAULT TRUE,
    CONSTRAINT unique_professor UNIQUE (id, start_date, end_date)
);

	
